import React from 'react';
import { Routes, Route } from 'react-router-dom';
import VietSilkApp from './frontend/Home.js'; // Trang chủ
import Products from './frontend/Products.js'; // Trang danh sách sản phẩm

function App() {
  return (
    <Routes>
      <Route path="/" element={<VietSilkApp />} />
      <Route path="/products" element={<Products />} />
    </Routes>
  );
}

export default App;
